import React, { component } from "react";
//import Axios from 'axios';

class tableau extends Component {
  constructor(props) {
    super(props);
    this.state = {
      posts: [],
    };
  }
  componentDidMount() {
    const url = "http://localhost:5000/lawyersReporter";
    fetch(url, {
      method: "GET",
    })
      .then((response) => response.json())
      .then((posts) => {
        console.log("post", posts);
      });
  }

  render() {
    return (
      <div>
        <button>Lawyers</button>
        <h1>Employed Lawyers :{this.state.lawyer}</h1>
      </div>
    );
  }
}

export default tableau;
